import React, { useState } from "react";
import style from "./a.module.css";
import chat from "../../assets/chat.png";
import larki from "../../assets/larki.png";
import Navbar from "../Navbar/Navbar";
import Modal from "../Modal/Modal.js";
import admission from "../../assets/admi.jpeg";

const HomeHero = () => {
  const [show, setShow] = useState(false);

  const handleClicked = () => {
    setShow(!show);
    console.log(show);
  };

  const AdmissionForm = ( ) => {
    return (
      <div className={style.admissionForm}>
        <div>
          <img src={admission} className={style.admissionPoster}></img>
        </div>
          <div>
          <p>Name</p>

          </div>
      </div>
    )
  }
  return (
    <div className={style.homeHero}>
      <Navbar />
      <div className={style.content}>
        <div className={style.left}>
          <h1 className={style.title}>HERO TEXT LOREM EPSUM</h1>
          <p className={style.text}>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent
            varius accumsan arcu sit amet ornare. Maecenas vel dui nec diam
            luctus mollis. Aliquam sed nulla ut sapien bibendum bibendum.
          </p>
          <div className={style.button}>
            <button className={style.button_search}>Search</button>
            <button className={style.button_python}>Python</button>
          </div>
        </div>
        <div className={style.right}>
          <img src={larki} alt="" />
        </div>
      </div>
      <div className={style.enquiry} onClick={handleClicked}>
        Admission Enquiry Form
      </div>
      <div className={style.chat}>
        <h1>Chat</h1>
      </div>
      <Modal title="My Modal" onClose={() => setShow(false)} show={show}>
        <AdmissionForm />
      </Modal>
    </div>
  );
};

export default HomeHero;
